"""### An√°lisis de valores faltantes

Cuando hay valores faltantes, se coloca un ``NaN``, lo que indica que no hay un valor especificado para ese √≠ndice/celda. Puede haber m√∫ltiples razones por la cual un valor puede ser ``NaN``, por ejemplo:

* Los datos son obtenidos de una fuente externa y hay valores incompletos.
* Se mergean dos dataset y algunos valores no se pueden matchear (por ejemplo, al hacer join left o right).
* Errores al recolectar los datos.
* Cambia la forma de los datos y hay algunas filas o columnas adicionales que no est√°n determinadas.
* Se reindexan los datos, lo que resulta en datos incompletos.

Los ``NaN`` pueden aparecer de diversas formas:
    
* Una fila completa puede ser ``NaN``.
* Una columna completa puede ser ``NaN``.
* Solo algunos valores en una fila o columna pueden ser ``NaN``.

Es importante eliminar los valores nulos, dado que puede ser que las t√©cnicas que usemos despu√©s no los soporten.

Para encontrar los valores nulos podemos utilizar la funci√≥n ``isnull()``.
"""

df_wines.isnull()

"""Los valores ``True`` nos indican las celdas que son ``Nan``. De forma alternativa, podemos utilizar la funci√≥n ``notnull()`` que hace (casi) lo mismo, en este caso, los ``True`` son los valores que no son nulos."""

df_wines.notnull()

"""Podemos utilizar el m√©todo ``sum()`` para contar la cantidad de valores nulos para cada columna/serie. Se sigue la l√≥gica de que ``True`` suma 1, mientras que el ``False`` suma 0."""

df_wines.isnull().sum()

"""Para obtener la cantidad todal de nulos en el ``df``, podemos hacer un ``sum`` del ``sum``."""

df_wines.isnull().sum().sum()

"""Al rev√©s, podemos contar cu√°ntos valores son no nulos."""

df_wines.count()

"""#### Elminando nulos

Una de las alternativas para tratar con valores nulos es simplemente eliminarlos de nuestros datos. Para ello, podemos utilizar la funci√≥n ``dropna()``, el cual nos va a retornar una copia del ``df`` eliminando las filas con nulos.
"""

df_wines.dropna()

"""Como elimina todas las filas donde haya al menos un nulo, el resultado es un ``df`` vac√≠o.

Podr√≠amos querer solo borrar las filas que son completamente nulas, seteando ``how='all'``.
"""

df_wines.dropna(how='all')

"""Tambi√©n podemos decidir borrar no en funci√≥n de las filas, sino de las columnas. Para eso hay que pasar por par√°metro ``axis=1`` o ``axis='columns'``."""

df_wines.dropna(axis=1)

"""Tambi√©n podemos definir un threshold a partir del cual realizar el borrado. Por ejemplo, que borre las filas si tiene m√°s de 5 valores no nulos, o incluso una lista de columnas en las cuales chequear los nulos."""

df_wines.dropna(thresh=len(df_wines.columns)- 3)

"""#### Operando con nulos

Pandas y numpy manejan de forma distinta los nulos:
    
* Cuando una funci√≥n de numpy se encuentra con un nulo, retorna ``NaN``.
* Cuando pandas se encuentra con un nulo, lo ignora y sigue con el procesamiento. Por ejemplo, si est√° haciendo una suma, los ``NaN``, son considerados como 0, excepto que todos sean ``NaN``, en cuyo caso, el resultado es tambi√©n ``NaN``.

#### Completando nulos

Una alternativa a borrar los nulos, es reemplazarlos por alg√∫n valor particular. Para esto, se puede utilizar la funci√≥n ``fillna``.
"""

df_wines_0 = df_wines.fillna(0)
df_wines_0

"""Este reemplazo de los nulos por ceros, va a afectar las caracter√≠sticas estad√≠sticas del dataset. Por ejemplo:"""

df_wines.mean()

df_wines_0.mean()

df_wines.mean() - df_wines_0.mean()

"""Podemos observar que, depende de la columna hay cambios de m√°s de 5 unidades. Entonces, puede que reemplazar por cero no sea la mejor opci√≥n.

Los nulos tambi√©n pueden ser completados por los √∫ltimos valores conocidos haciendo "forward-filling":
"""

df_wines.fillna(method='ffill')

df_wines.fillna(method='bfill') # haciendo backward-filling

"""En el √∫ltimo ejemplo al hacer el "backward filling", como no hay nada anterior a la √∫ltima fila, la misma no puede ser reemplazada y va a quedar con los nulos.

#### Interpolando valores

Pandas tiene la funci√≥n ``interpolate()`` tanto para las ``Series`` como para los ``df``. En este caso, para completar los valores faltantes realiza una interpolaci√≥n lineal.
"""

df_wines.interpolate()

"""Para este ejemplo, vamos a borrar todas las filas y columnas que sean completamente nulas y vamos a reemplazar los valores faltantes con la media de la columna."""

df_wines.dropna(how='all',inplace=True) # filas completas de nulos
df_wines.dropna(how='all',inplace=True,axis=1) # columnas completas de nulos
df_wines.fillna(df_wines.mean(),inplace=True)
df_wines

