# 1. En el dataframe df_wines tengo  el dataset completo. Mi objetivo es predecir 'quality' (y) en funcion
# del resto de las variables (X)
df_wines

from sklearn.model_selection import train_test_split

# 2. Separo el dataset en 2 partes, para validacion simple
train_set, test_set = train_test_split(df_wines, test_size=0.2, random_state=42) # Hacemos una division 80/20%

train_set.head()

# Tomo las variables regresoras en X (y descarto 'quality' de ese dataframe)
X_train = train_set.drop('quality', axis=1)
# X_train = X_train[['fixed acidity', 'residual sugar', 'alcohol']]

# Tomo la variable a dependiente/a predecir
y_train = train_set['quality'].copy()

from sklearn.linear_model import LinearRegression

# 3. Aplico el modelo de regresi√≥n (de sklearn)
lr_model = LinearRegression()
lr_model.fit(X_train, y_train) # Construcci√≥n/inferencia del modelo

from sklearn.metrics import r2_score
from sklearn.metrics import mean_squared_error

# Hago predecir el modelo generado sobre el conjunto de training
y_pred = lr_model.predict(X_train)

# 4. Evaluo la performance del modelo sobre el conjunto de training, mediante R2 y RMSE
r2 = r2_score(y_train, y_pred)
print("Train R2=", r2)
mse = mean_squared_error(y_train, y_pred)
print("Train RMSE=", np.sqrt(mse))

# Repito el procedimiento anterior, pero ahora sobre el conjunto de test

# Tomo las variables regresoras en X (y descarto 'quality' de ese dataframe)
X_test = test_set.drop('quality', axis=1)
# X_test = X_test[['fixed acidity', 'residual sugar', 'alcohol']]
# Tomo la variable a dependiente/a predecir
y_test = test_set['quality'].copy()

# Hago predecir el modelo generado sobre el conjunto de test
