# 6. Interpretar los pesos de los coeficientes mas importantes
# Para esto, voy a graficar los pesos de todos los coeficientes utilizados por el modelo

def plot_coefficients(cdf, technique=None): # Funcion auxiliar para dibujar
  fig, ax = plt.subplots(figsize=(20, 8))
  ax.stem(cdf.index, cdf['Coefficients'], markerfmt=' ')
  ax.set_xlabel('variable')
  ax.set_ylabel('coefficients')
  ax.set_title(technique);
  plt.xticks(rotation=45, fontsize=14)
  plt.show()

cdf = pd.DataFrame(lr_model.coef_, X_train.columns, columns=['Coefficients'])
plot_coefficients(cdf, "Pesos de las variables seg√∫n Regresion Lineal (sklearn)")

from sklearn.model_selection import cross_val_score

# 7. Ahora hago una validacion cruzada sobre todo el dataset, con R2 como m√©trica y 10 folds
X = df_wines.drop('quality', axis=1)
y = df_wines['quality'].copy()

# Aplicamos el procedimiento de crossvalidation, usando R2 como metrica
scores = cross_val_score(lr_model, X, y, scoring="r2", cv=10)

